import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Provider } from 'react-redux';
import { store } from './store';
import LoginPage from './pages/LoginPage';
import DashboardPage from './pages/DashboardPage';
import InventoryPage from './pages/InventoryPage';
import POSPage from './pages/POSClean';
import DistributorPortalPage from './pages/DistributorPortalPage';
import ConsignmentLoansPage from './pages/ConsignmentLoansPage';
import TestNavigation from './pages/TestNavigation';
import { useAuth } from './context/AuthContext';
import ErrorBoundary from './components/ErrorBoundary';
import './styles/pos.css';

// Componente de ruta protegida
const PrivateRoute: React.FC<{ children: React.ReactElement }> = ({ children }) => {
  const { isAuthenticated } = useAuth();
  return isAuthenticated ? children : <Navigate to="/login" />;
};

function App() {
  return (
    <Provider store={store}>
      <ErrorBoundary>
        <Router
          future={{
            v7_startTransition: true,
            v7_relativeSplatPath: true
          }}
        >
          <div className="App">
          <Routes>
            <Route path="/login" element={<LoginPage />} />
            <Route path="/distributor-portal" element={<DistributorPortalPage />} />
            <Route path="/pos-test" element={<POSPage />} />
            <Route path="/test" element={<TestNavigation />} />
            <Route path="/" element={<Navigate to="/test" />} />
            <Route
              path="/dashboard"
              element={
                <PrivateRoute>
                  <DashboardPage />
                </PrivateRoute>
              }
            />
            <Route
              path="/inventory"
              element={
                <PrivateRoute>
                  <InventoryPage />
                </PrivateRoute>
              }
            />
            <Route
              path="/pos"
              element={
                <PrivateRoute>
                  <POSPage />
                </PrivateRoute>
              }
            />
            <Route
              path="/consignments"
              element={
                <PrivateRoute>
                  <ConsignmentLoansPage />
                </PrivateRoute>
              }
            />
          </Routes>
          </div>
        </Router>
      </ErrorBoundary>
    </Provider>
  );
}

export default App;
